u044b\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B8%D0%B2%D0%BE\" title=\"\u041f\u0438\u0432\u043e\">\u043f\u0438\u0432\u043e<\/a> \u0432 \u043a\u0430\u0447\u0435\u0441\u0442\u0432\u0435 \u043b\u0435\u043a\u0430\u0440\u0441\u0442\u0432\u0430 \u0438 \u043e\u0431\u0445\u043e\u0434\u0438\u0442\u044c \u0442\u0435\u043c \u0441\u0430\u043c\u044b\u043c \u00ab\u0441\u0443\u0445\u043e\u0439 \u0437\u0430\u043a\u043e\u043d\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1922_%D0%B3%D0%BE%D0%B4\" title=\"1922 \u0433\u043e\u0434\">1922<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%B8%D0%BD,_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_%D0%A1%D1%82%D0%B5%D0%BF%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0413\u0440\u0438\u043d, \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u0421\u0442\u0435\u043f\u0430\u043d\u043e\u0432\u0438\u0447\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u0413\u0440\u0438\u043d<\/a> \u0437\u0430\u0432\u0435\u0440\u0448\u0438\u043b \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" class=\"mw-redirect\" title=\"\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0435<\/a> \u043d\u0430\u043f\u0438\u0441\u0430\u043d\u0438\u0435 \u0444\u0430\u043d\u0442\u0430\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u0444\u0435\u0435\u0440\u0438\u0438 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D1%8B%D0%B5_%D0%BF%D0%B0%D1%80%D1%83%D1%81%D0%B0\" title=\"\u0410\u043b\u044b\u0435 \u043f\u0430\u0440\u0443\u0441\u0430\">\u0410\u043b\u044b\u0435 \u043f\u0430\u0440\u0443\u0441\u0430<\/a>\u00bb, \u043f\u043e\u0441\u0432\u044f\u0442\u0438\u0432 \u0435\u0451 \u0441\u0432\u043e\u0435\u0439 \u0436\u0435\u043d\u0435 \u041d\u0438\u043d\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1923_%D0%B3%D0%BE%D0%B4\" title=\"1923 \u0433\u043e\u0434\">1923<\/a><ul><li><a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%A8%D0%B8%D0%BA,_%D0%AF%D0%BA%D0%BE%D0%B1&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0428\u0438\u043a, \u042f\u043a\u043e\u0431 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u042f\u043a\u043e\u0431 \u0428\u0438\u043a<\/a> \u0437\u0430\u043f\u0430\u0442\u0435\u043d\u0442\u043e\u0432\u0430\u043b \u043f\u0435\u0440\u0432\u0443\u044e \u044d\u043b\u0435\u043a\u0442\u0440\u043e\u0431\u0440\u0438\u0442\u0432\u0443.<\/li><li>\u0417\u0430\u043f\u0440\u0435\u0449\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BC%D0%BC%D1%83%D0%BD%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%BF%D0%B0%D1%80%D1%82%D0%B8%D1%8F_%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D0%B8%D0%B8\" title=\"\u041a\u043e\u043c\u043c\u0443\u043d\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043f\u0430\u0440\u0442\u0438\u044f \u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438\">\u041a\u043e\u043c\u043c\u0443\u043d\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u043f\u0430\u0440\u0442\u0438\u0438 \u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438<\/a>.<\/li><li>\u0413\u0435\u0440\u043c\u0430\u043d\u0441\u043a\u0438\u0439 \u043a\u0430\u043d\u0446\u043b\u0435\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D1%82%D1%80%D0%B5%D0%B7%D0%B5%D0%BC%D0%B0%D0%BD,_%D0%93%D1%83%D1%81%D1%82%D0%B0%D0%B2\" title=\"\u0428\u0442\u0440\u0435\u0437\u0435\u043c\u0430\u043d, \u0413\u0443\u0441\u0442\u0430\u0432\">\u0413\u0443\u0441\u0442\u0430\u0432 \u0428\u0442\u0440\u0435\u0437\u0435\u043c\u0430\u043d<\/a> \u043f\u0440\u0438 \u0433\u043e\u043b\u043e\u0441\u043e\u0432\u0430\u043d\u0438\u0438 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%BB%D0%B0%D0%BC%D0%B5%D0%BD%D1%82\" title=\"\u041f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442\">\u043f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442\u0435<\/a> \u043e \u0434\u043e\u0432\u0435\u0440\u0438\u0438 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0443 \u0442\u0435\u0440\u043f\u0438\u0442 \u043d\u0435\u0443\u0434\u0430\u0447\u0443 \u0438 \u0443\u0445\u043e\u0434\u0438\u0442 \u0432 \u043e\u0442\u0441\u0442\u0430\u0432\u043a\u0443. \u041d\u043e\u0432\u044b\u043c \u043a\u0430\u043d\u0446\u043b\u0435\u0440\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u044f\">\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438<\/a> \u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u0441\u044f \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u0438\u0442\u0435\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D1%82%D0%B8%D1%8F_%D0%A6%D0%B5%D0%BD%D1%82%D1%80%D0%B0_(%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D0%B8%D1%8F)\" title=\"\u041f\u0430\u0440\u0442\u0438\u044f \u0426\u0435\u043d\u0442\u0440\u0430 (\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u044f)\">\u0446\u0435\u043d\u0442\u0440\u0438\u0441\u0442\u0441\u043a\u043e\u0439 \u043f\u0430\u0440\u0442\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%80%D0%BA%D1%81,_%D0%92%D0%B8%D0%BB%D1%8C%D0%B3%D0%B5%D0%BB%D1%8C%D0%BC\" title=\"\u041c\u0430\u0440\u043a\u0441, \u0412\u0438\u043b\u044c\u0433\u0435\u043b\u044c\u043c\">\u0412\u0438\u043b\u044c\u0433\u0435\u043b\u044c\u043c \u041c\u0430\u0440\u043a\u0441<\/a>.<\/li><li>\u0424\u043e\u0440\u043c\u0438\u0440\u0443\u0435\u0442\u0441\u044f 100-\u044f \u0441\u0442\u0440\u0435\u043b\u043a\u043e\u0432\u0430\u044f \u0434\u0438\u0432\u0438\u0437\u0438\u044f (\u0441 1941&#160;\u2014 \u041f\u0435\u0440\u0432\u0430\u044f \u0433\u0432\u0430\u0440\u0434\u0435\u0439\u0441\u043a\u0430\u044f \u0434\u0438\u0432\u0438\u0437\u0438\u044f).<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1924\" class=\"mw-redirect\" title=\"1924\">1924<\/a>&#160;\u2014 \u0421\u043e\u0441\u0442\u043e\u044f\u043b\u0430\u0441\u044c \u043f\u0435\u0440\u0432\u0430\u044f \u0448\u0438\u0440\u043e\u043a\u043e\u0432\u0435\u0449\u0430\u0442\u0435\u043b\u044c\u043d\u0430\u044f \u043f\u0435\u0440\u0435\u0434\u0430\u0447\u0430 \u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u043e\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B0%D0%B4%D0%B8%D0%BE\" title=\"\u0420\u0430\u0434\u0438\u043e\">\u0440\u0430\u0434\u0438\u043e<\/a>. \u041d\u0430\u0447\u0430\u043b\u043e \u0440\u0435\u0433\u0443\u043b\u044f\u0440\u043d\u043e\u0433\u043e \u0440\u0430\u0434\u0438\u043e\u0432\u0435\u0449\u0430\u043d\u0438\u044f \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0421\u0421\u0421\u0420\">\u0421\u0421\u0421\u0420<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1928\" class=\"mw-redirect\" title=\"1928\">1928<\/a>&#160;\u2014 \u0412 \u041c\u043e\u0441\u043a\u0432\u0435 \u043e\u0442\u043a\u0440\u044b\u043b\u0441\u044f \u0414\u0432\u043e\u0440\u0435\u0446 \u043a\u0443\u043b\u044c\u0442\u0443\u0440\u044b \u0436\u0435\u043b\u0435\u0437\u043d\u043e\u0434\u043e\u0440\u043e\u0436\u043d\u0438\u043a\u043e\u0432. \u0421\u043e\u0433\u043b\u0430\u0441\u043d\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B2%D0%B5%D0%BD%D0%B0%D0%B4%D1%86%D0%B0%D1%82%D1%8C_%D1%81%D1%82%D1%83%D0%BB%D1%8C%D0%B5%D0%B2\" title=\"\u0414\u0432\u0435\u043d\u0430\u0434\u0446\u0430\u0442\u044c \u0441\u0442\u0443\u043b\u044c\u0435\u0432\">\u0418\u043b\u044c\u0444\u0443 \u0438 \u041f\u0435\u0442\u0440\u043e\u0432\u0443<\/a>, \u043f\u043e\u0441\u0442\u0440\u043e\u0435\u043d \u043e\u043d \u0431\u044b\u043b \u0431\u043b\u0430\u0433\u043e\u0434\u0430\u0440\u044f \u0434\u0440\u0430\u0433\u043e\u0446\u0435\u043d\u043d\u043e\u0441\u0442\u044f\u043c \u0442\u0451\u0449\u0438 \u0418\u043f\u043f\u043e\u043b\u0438\u0442\u0430 \u041c\u0430\u0442\u0432\u0435\u0435\u0432\u0438\u0447\u0430 \u0412\u043e\u0440\u043e\u0431\u044c\u044f\u043d\u0438\u043d\u043e\u0432\u0430, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u0431\u044b\u043b\u0438 \u0441\u043f\u0440\u044f\u0442\u0430\u043d\u044b \u0432 12-\u043c \u0441\u0442\u0443\u043b\u0435 \u0438\u0437 \u0433\u0430\u0440\u043d\u0438\u0442\u0443\u0440\u0430 \u043c\u0430\u0441\u0442\u0435\u0440\u0430 \u0413\u0430\u043c\u0431\u0441\u0430. \u0412 \u0440\u0435\u0430\u043b\u044c\u043d\u043e\u0441\u0442\u0438 \u044d\u0442\u043e \u043d\u0435 \u0441\u043e\u043e\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0443\u0435\u0442 \u0438\u0441\u0442\u0438\u043d\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1934\" class=\"mw-redirect\" title=\"1934\">1934<\/a>&#160;\u2014 \u041d\u0430 \u0446\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u044b\u0445 \u0434\u043e\u0440\u043e\u0433\u0430\u0445 \u0410\u043c\u0435\u0440\u0438\u043a\u0438 \u0438 \u0415\u0432\u0440\u043e\u043f\u044b \u043d\u0430\u0447\u0438\u043d\u0430\u044e\u0442 \u0443\u0441\u0442\u0430\u043d\u0430\u0432\u043b\u0438\u0432\u0430\u0442\u044c \u043d\u0435\u0434\u0430\u0432\u043d\u043e \u0438\u0437\u043e\u0431\u0440\u0435\u0442\u0451\u043d\u043d\u044b\u0435 \u0441\u0432\u0435\u0442\u043e\u0432\u043e\u0437\u0432\u0440\u0430\u0449\u0430\u044e\u0449\u0438\u0435 \u043e\u0442\u0440\u0430\u0436\u0430\u0442\u0435\u043b\u0438 \u0434\u043b\u044f \u0440\u0430\u0437\u0434\u0435\u043b\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u0445 \u043f\u043e\u043b\u043e\u0441.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1935\" class=\"mw-redirect\" title=\"1935\">1935<\/a>&#160;\u2014 \u0410\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439 \u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%BB%D0%BB%D1%81%D0%B2%D0%BE%D1%80%D1%82,_%D0%9B%D0%B8%D0%BD%D0%BA%D0%BE%D0%BB%D1%8C%D0%BD\" class=\"mw-redirect\" title=\"\u042d\u043b\u043b\u0441\u0432\u043e\u0440\u0442, \u041b\u0438\u043d\u043a\u043e\u043b\u044c\u043d\">\u041b\u0438\u043d\u043a\u043e\u043b\u044c\u043d \u042d\u043b\u043b\u0441\u0432\u043e\u0440\u0442<\/a> \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u043f\u0440\u043e\u043b\u0435\u0442\u0430\u0435\u0442 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BC%D0%BE%D0%BB%D1%91%D1%82\" title=\"\u0421\u0430\u043c\u043e\u043b\u0451\u0442\">\u0441\u0430\u043c\u043e\u043b\u0451\u0442\u0435<\/a> \u0447\u0435\u0440\u0435\u0437 \u0432\u0441\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D1%82%D0%B0%D1%80%D0%BA%D1%82%D0%B8%D0%B4%D0%B0\" title=\"\u0410\u043d\u0442\u0430\u0440\u043a\u0442\u0438\u0434\u0430\">\u0410\u043d\u0442\u0430\u0440\u043a\u0442\u0438\u0434\u0443<\/a>, \u043e\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%80%D0%B5_%D0%A3%D1%8D%D0%B4%D0%B4%D0%B5%D0%BB%D0%BB%D0%B0\" title=\"\u041c\u043e\u0440\u0435 \u0423\u044d\u0434\u0434\u0435\u043b\u043b\u0430\">\u043c\u043e\u0440\u044f \u0423\u044d\u0434\u0434\u0435\u043b\u043b\u0430<\/a> \u0434\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%80%D0%B5_%D0%A0%D0%BE%D1%81%D1%81%D0%B0\" title=\"\u041c\u043e\u0440\u0435 \u0420\u043e\u0441\u0441\u0430\">\u043c\u043e\u0440\u044f \u0420\u043e\u0441\u0441\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1936\" class=\"mw-redirect\" title=\"1936\">1936<\/a><ul><li>\u0412\u044b\u0448\u0435\u043b \u043f\u0435\u0440\u0432\u044b\u0439 \u043d\u043e\u043c\u0435\u0440 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0433\u043e \u0436\u0443\u0440\u043d\u0430\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/Life_(%D0%B6%D1%83%D1%80%D0%BD%D0%B0%D0%BB)\" title=\"Life (\u0436\u0443\u0440\u043d\u0430\u043b)\">\u00abLife\u00bb<\/a>.<\/li><li>\u0412 \u041c\u0435\u043a\u0441\u0438\u043a\u0435 \u043f\u0440\u0438\u043d\u044f\u0442 \u0437\u0430\u043a\u043e\u043d, \u043d\u0430\u0434\u0435\u043b\u044f\u044e\u0449\u0438\u0439 \u043f\u0440\u0430\u0432\u0438\u0442\u0