ref=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%B0%D0%BA%D1%83%D0%BB%D1%8C%D1%82%D0%B5%D1%82_%D0%B6%D1%83%D1%80%D0%BD%D0%B0%D0%BB%D0%B8%D1%81%D1%82%D0%B8%D0%BA%D0%B8_%D0%9C%D0%93%D0%A3\" title=\"\u0424\u0430\u043a\u0443\u043b\u044c\u0442\u0435\u0442 \u0436\u0443\u0440\u043d\u0430\u043b\u0438\u0441\u0442\u0438\u043a\u0438 \u041c\u0413\u0423\">\u0444\u0430\u043a\u0443\u043b\u044c\u0442\u0435\u0442\u0430 \u0436\u0443\u0440\u043d\u0430\u043b\u0438\u0441\u0442\u0438\u043a\u0438 \u041c\u0413\u0423<\/a> \u043f\u043e\u043a\u0438\u0434\u0430\u0435\u0442 \u043f\u043e\u0441\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B5%D0%BA%D0%B0%D0%BD_(%D1%84%D0%B0%D0%BA%D1%83%D0%BB%D1%8C%D1%82%D0%B5%D1%82)\" class=\"mw-redirect\" title=\"\u0414\u0435\u043a\u0430\u043d (\u0444\u0430\u043a\u0443\u043b\u044c\u0442\u0435\u0442)\">\u0434\u0435\u043a\u0430\u043d\u0430<\/a>, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u0437\u0430\u043d\u0438\u043c\u0430\u043b \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1965_%D0%B3%D0%BE%D0%B4\" title=\"1965 \u0433\u043e\u0434\">1965&#160;\u0433\u043e\u0434\u0430<\/a>. \u041e\u0434\u043d\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u043e \u043e\u043d \u0438\u0437\u0431\u0440\u0430\u043d \u043d\u0430 \u043d\u043e\u0432\u0443\u044e \u0434\u043e\u043b\u0436\u043d\u043e\u0441\u0442\u044c \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u0430 \u0444\u0430\u043a\u0443\u043b\u044c\u0442\u0435\u0442\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2015\" class=\"mw-redirect\" title=\"2015\">2015<\/a>&#160;\u2014 \u0417\u0430\u0432\u0435\u0440\u0448\u0438\u043b\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D0%BB%D0%BE%D1%81%D0%BE%D0%B2%D0%B0%D0%BD%D0%B8%D0%B5_%D0%BF%D0%BE_%D0%B2%D0%BE%D0%BF%D1%80%D0%BE%D1%81%D1%83_%D0%BF%D0%B5%D1%80%D0%B5%D0%B8%D0%BC%D0%B5%D0%BD%D0%BE%D0%B2%D0%B0%D0%BD%D0%B8%D1%8F_%D1%81%D1%82%D0%B0%D0%BD%D1%86%D0%B8%D0%B8_%D0%BC%D0%B5%D1%82%D1%80%D0%BE_%C2%AB%D0%92%D0%BE%D0%B9%D0%BA%D0%BE